CREATE TABLE IF NOT EXISTS `CountryDataEx` (
  `_id` INTEGER PRIMARY KEY AUTOINCREMENT,
  `ARRLPrefix` varchar(255) DEFAULT NULL,
  `Comment` varchar(255) DEFAULT NULL,
  `Continent` varchar(255) DEFAULT NULL,
  `Country` varchar(255) DEFAULT NULL,
  `CQZone` double DEFAULT NULL,
  `DXCC` double DEFAULT NULL,
  `ITUZone` double DEFAULT NULL,
  `Latitude` varchar(255) DEFAULT NULL,
  `Longitude` varchar(255) DEFAULT NULL,
  `PrefixList` varchar(255) DEFAULT NULL,
  `Status` varchar(255) DEFAULT NULL,
  `StartDate` datetime DEFAULT NULL,
  `TimeDiff` double DEFAULT NULL,
  `ns3:forcenull` varchar(255) DEFAULT NULL,
  `EndDate` datetime DEFAULT NULL
);




